function Navbar() {
    return (
      <div className="navContainer">
        <h1> Leasly</h1>
        <div className="accountIcon">
            <span className="material-symbols-outlined"> account_circle </span>
        </div>
      </div>
    );
  }
  
  export default Navbar;
